import { useState, useEffect } from "react";

const AirportTable = () => {
  const [airports, setAirports] = useState([]);
  const [filteredAirports, setFilteredAirports] = useState([]);
  const [searchQuery, setSearchQuery] = useState(""); // Existing search state
  const [page, setPage] = useState(1);
  const [total, setTotal] = useState(0);
  const limit = 25;

  useEffect(() => {
    const fetchAirports = async () => {
      const res = await fetch(`http://localhost:5050/airports?page=${page}&limit=${limit}`);
      const data = await res.json();
      setAirports(data.data);
      setTotal(data.total);
    };

    fetchAirports();
  }, [page]);

  // Apply filter based on airport name search query
  useEffect(() => {
    if (searchQuery) {
      const filtered = airports.filter((airport) =>
        airport.name.toLowerCase().includes(searchQuery.toLowerCase())
      );
      setFilteredAirports(filtered);
    } else {
      setFilteredAirports(airports);
    }
  }, [searchQuery, airports]);

  const totalPages = Math.ceil(total / limit);

  return (
    <div>
      {/* Existing search bar */}
      <div className="my-4">
        <input
          type="text"
          placeholder="Search by airport name"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          className="p-2 border border-gray-300 rounded w-full"
        />
      </div>

      <table className="w-full border">
        <thead>
          <tr>
            <th className="p-2 border">Name</th>
            <th className="p-2 border">City</th>

            <th className="p-2 border">Country</th>
            <th className="p-2 border">Region</th>
            <th className="p-2 border">Elevation</th>
            <th className="p-2 border">IATA</th>
            <th className="p-2 border">ICAO</th>
            <th className="p-2 border">Latitude</th>
            <th className="p-2 border">Longitude</th>
            <th className="p-2 border">Timezone</th>
          </tr>
        </thead>
        <tbody>
          {filteredAirports.map((airport, idx) => (
            <tr key={idx} className={airport.elevation > 8000 ? "bg-red-100 font-bold" : ""}>
              <td className="p-2 border">{airport.name}</td>
              <td className="p-2 border">{airport.city}</td>
              <td className="p-2 border">{airport.country}</td>
              <td className="p-2 border">{airport.region || "-"}</td>
              <td className="p-2 border">{airport.elevation} ft</td>
              <td className="p-2 border">{airport.iata || "-"}</td>
              <td className="p-2 border">{airport.icao || "-"}</td>
              <td className="p-2 border">{airport.lat || "-"}</td>
              <td className="p-2 border">{airport.lon || "-"}</td>
              <td className="p-2 border">{airport.tz || "-"}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Pagination Controls */}
      <div className="flex justify-center gap-2 mt-4">
        <button
          disabled={page === 1}
          onClick={() => setPage((prev) => prev - 1)}
          className="px-3 py-1 bg-gray-200 hover:bg-gray-300 rounded disabled:opacity-50"
        >
          Previous
        </button>
        <span className="px-3 py-1 text-sm text-gray-700">
          Page {page} of {totalPages}
        </span>
        <button
          disabled={page === totalPages}
          onClick={() => setPage((prev) => prev + 1)}
          className="px-3 py-1 bg-gray-200 hover:bg-gray-300 rounded disabled:opacity-50"
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default AirportTable;
